import React from 'react'
import '../css/PausedPage.css'

const PausedPage = () => {

    return (
        <div className='pause__card'>
            <div className='pause__alert'>
                <h2>Game Paused</h2>
                <buttonn>Resume</buttonn>
                <button>New Game</button>
                <button>High Score</button>
                
            </div>
        </div>
    )
}

export default PausedPage;
